// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import StudentList from './components/Student/StudentList';
import CourseList from './components/Course/CourseList';
import FacultyList from './components/Faculty/FacultyList';
import './styles/'// Import global styles
import './styles/HomePage.css'; // Import specific styles for HomePage
import './styles/StudentsPage.css'; // Import specific styles for StudentsPage
import './styles/CoursesPage.css'; // Import specific styles for CoursesPage
import './styles/FacultyPage.css'; // Import specific styles for FacultyPage

const App = () => {
  return (
    <Router>
      <div>
        {/* Global Header */}
        <header>
          <h1>College Management System</h1>
          <nav>
            <Link to="/">Home</Link>
            <Link to="/students">Students</Link>
            <Link to="/courses">Courses</Link>
            <Link to="/faculty">Faculty</Link>
          </nav>
        </header>

        {/* Main Routes */}
        <main>
          <Routes>
            <Route path="/" element={<h1>Welcome to College Management System</h1>} />
            <Route path="/students" element={<StudentList />} />
            <Route path="/courses" element={<CourseList />} />
            <Route path="/faculty" element={<FacultyList />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
